Rules.InvariantScript:
If(
    !IsBlank(SelectedResponse),
    With(
        SelectedResponse.Source As CandidateInfo,
        Ungroup(
            [
                Table(
                    {
                        tag: "name",
                        concept: "Candidate name",
                        value: CandidateInfo.name
                    },
                    {
                        tag: "idNumber",
                        concept: "Identification",
                        value: CandidateInfo.idNumber
                    },
                    {
                        tag: "address",
                        concept: "Address",
                        value: CandidateInfo.address
                    },
                    {
                        tag: "educationalLevel",
                        concept: "Educational level",
                        value: FormResponseSelector.CodeToEducationalDegree(CandidateInfo.educationalLevel).Name
                    },
                    {
                        tag: "fieldStudy",
                        concept: "Field study",
                        value: CandidateInfo.fieldStudy
                    },
                    {
                        tag: "maritalStatus",
                        concept: "Marital status",
                        value: FormResponseSelector.CodeToMaritalStatus(CandidateInfo.maritalStatus).Name
                    },
                    {
                        tag: "bithCity",
                        concept: "Birth city",
                        value: CandidateInfo.birthCity
                    },
                    {
                        tag: "birthDate",
                        concept: "Birth date",
                        value: FormResponseSelector.FormatDateValue(CandidateInfo.birthDate)
                    },
                    {
                        tag: "nationality",
                        concept: "Nationality",
                        value: CandidateInfo.nationality
                    },
                    {
                        tag: "phoneNumber",
                        concept: "Phone",
                        value: CandidateInfo.phoneNumber
                    },
                    {
                        tag: "gender",
                        concept: "Gender",
                        value: FormResponseSelector.CodeToGender(CandidateInfo.gender).Name
                    }
                ),
                First(SelectedResponse.DynamicContent).items
            ],
            "Value"
        )
    )
)

Set(
    DefaultSearchText,
    FormResponseSelector.DefaultSearch
);
Reset(txtSearch_FormResponseSelector);
Set(
    SelectedResponse,
    Blank()
)
